import { React } from 'react';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Layout from '../containers/Layout'

import Home from './components/Home';

function App() {
  return(
    <div className="App">
      <Router>
        <Layout>
          <Routes>
            <Route exact path="/" element={<Home/>}/>
          </Routes>
        </Layout>
      </Router>
    </div>
  );
}

export default App;
